import Greenbtn from './Greenbtn';
import { GoThreeBars } from "react-icons/go";
import {  FaTimes } from "react-icons/fa";
import { SiTwitch, SiLinkedin, SiFacebook } from "react-icons/si";
import { useState } from 'react';

const Navbar = () => {

  const [navigation, setNavigation] = useState(false )

  const links = [
    {
      id: 1,
      link: 'home',
    },
    {
      id: 2,
      link: 'services',
    },
    {
      id: 3,
      link: 'about',
    },
    {
      id: 4,
      link: 'support',
    },
    {
      id: 5,
      link: 'pricing',
    },

  ]
  return (
    <div className='w-screen h-20 z-20 fixed bg-gray-900 text-white'>
      <div className='px-3 flex items-center justify-between w-full h-full'>
        <div className='flex items-center'>
          <h1 className='text-4xl font-bold'>onnn</h1>
        </div>
        <ul className=' hidden md:flex'>
          {links.map((link)=> (
            <li className='capitalize p-4 cursor-pointer hover:text-lightcolor duration-200 '>
              home
            </li>
          ))}
          
        </ul>
      </div>
    </div>
  )
}

export default Navbar
